import requests
import json

def get_type_of_instance(qid):
	def get_label(response):
		label = None
		response = json.loads(response)
		id_num = [k for k in response["entities"].keys()][0]
		languages = [k for k in response["entities"][id_num]["labels"].keys()]
		for lang in languages:
			if "fr" == lang:
				label = response["entities"][id_num]["labels"]["fr"]["value"]
				return label
			elif "en" == lang:
				label = response["entities"][id_num]["labels"]["en"]["value"]
				return label
		print("no EN nor FR labels -> {}".format(id_num))
		return label

	print(qid)
	url = qid
	r = requests.get(url)
	if str(r.status_code) == "500":
		print("no response form server for {}".format(qid))
		return None
	else:
		return get_label(r.text)


